import React, { useState } from 'react';
import axios from 'axios';
import { motion } from 'framer-motion';
import LoadingSpinner from '../components/LoadingSpinner';  // Changed from '../LoadingSpinner'
const OCTClassifier = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [selectedModel, setSelectedModel] = useState('mobilenet_v3');

  const handleFileSelect = async (event) => {
    const file = event.target.files[0];
    if (!file) return;

    try {
      setLoading(true);
      setError(null);
      setSelectedFile(file);
      setPreview(URL.createObjectURL(file));

      const formData = new FormData();
      formData.append('file', file);
      formData.append('model', selectedModel);

      const response = await axios.post('http://localhost:5000/api/classify', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      setResult(response.data);
    } catch (error) {
      console.error('Classification error:', error);
      setError(error.response?.data?.error || 'Failed to classify image');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-4">
      {/* Model Selection */}
      <div className="mb-6">
        <label className="block text-sm font-medium text-gray-700">Select Model</label>
        <select
          value={selectedModel}
          onChange={(e) => setSelectedModel(e.target.value)}
          className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
        >
          <option value="mobilenet_v3">MobileNet V3</option>
          <option value="efficientnet_b0">EfficientNet B0</option>
          <option value="resnet18">ResNet 18</option>
          <option value="resnet50">ResNet 50</option>
          <option value="squeezenet1_1">SqueezeNet</option>
          <option value="mobilevit">MobileViT</option>
        </select>
      </div>

      {/* File Upload */}
      <div className="mb-6">
        <label className="block text-sm font-medium text-gray-700">Upload Image</label>
        <input
          type="file"
          accept="image/*"
          onChange={handleFileSelect}
          className="mt-1 block w-full"
        />
      </div>

      {/* Loading State */}
      {loading && <LoadingSpinner />}

      {/* Error Message */}
      {error && (
        <div className="text-red-600 mb-4">
          {error}
        </div>
      )}

      {/* Results Display */}
      {result && (
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Original Image */}
          <div className="bg-white p-4 rounded-lg shadow">
            <h3 className="text-lg font-medium mb-2">Original Image</h3>
            <img
              src={`data:image/png;base64,${result.original}`}
              alt="Original"
              className="w-full rounded"
            />
          </div>

          {/* GradCAM Visualization */}
          <div className="bg-white p-4 rounded-lg shadow">
            <h3 className="text-lg font-medium mb-2">GradCAM Visualization</h3>
            <img
              src={`data:image/png;base64,${result.gradcam}`}
              alt="GradCAM"
              className="w-full rounded"
            />
          </div>

          {/* Classification Results */}
          <div className="md:col-span-2 bg-white p-4 rounded-lg shadow">
            <h3 className="text-lg font-medium mb-2">Classification Results</h3>
            <p className="text-gray-700">
              <span className="font-medium">Class:</span> {result.class}
            </p>
            <p className="text-gray-700">
              <span className="font-medium">Confidence:</span> {result.confidence.toFixed(2)}%
            </p>
          </div>
        </div>
      )}
    </div>
  );
};

export default OCTClassifier;
